import {Header, SobreNos, Footer, ImageSlider, Home} from '../src/components/Home/Home';

function App() {
  return (
    <>
      <SobreNos />
      <Footer />
      <ImageSlider />
      <Calendar />
      <MainPage />
    </>
  );
}
export default App;
